import React from "react";
import Navbar from "./components/navbar";

import headerImg from "./assets/PicForHeader.svg"; 

function App() {
  return (
    <div className="app">
        <div className="header-wrapper">
            <img src={headerImg} alt="Header" className="header-img" />
            <h1 className="header-text">Willkommen bei TeeShop</h1>
        </div>

      <Navbar />

    </div>
  );
}

export default App;
